import React from "react";
import { Card } from "../../UI/Card.styled";

const List = ({ fontSizes, UI, colors, items }) => {
  return (
    <>
      <Card bd={"1px solid red"}>
        <Card
          fw={"700"}
          fs={fontSizes.textHeader}
          bd={"1px solid blue"}
          height={"2rem"}
          cl={colors.darkGrey}
        >
          {items.Header}
        </Card>
        <Card mg={"2rem 1rem"} height={"5rem"} bd={"1px solid green"}></Card>
      </Card>
    </>
  );
};

export default List;
